    "national-bison-range-quarterly-narrative-report-august-september-and-october-1940",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for National Bison
    Range outlines Refuge accomplishments from August through October of 1940. The report
    begins by summarizing the weather conditions during this period. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    and mammals- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. Resource management
    is outlined; topics include fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, and violations. Photographs are attached.",nt"license_title":
